import React, { Fragment } from 'react';
import "./styles.css";
import { Container, Row, Col, Card, CardHeader, CardBody, Button, Media } from "reactstrap";
import Breadcrumb from '../../../../../../../layout/breadcrumb';
import ReactPlayer from 'react-player';


const ViewIndividualPurchasedCourseDataHelper = (props) => {
    return (
        <Fragment>
            <Breadcrumb parent="Viewing Course Data/Information (Purchased Content).." title={`You've Purchased This Course & The Data Is Now Available`}/>
            <Container fluid={true}>
                <Row>
                    <Col sm="12" md="12" lg="12" xl="12">
                        <Card className='shadow'>
                            <CardHeader className='b-l-info b-r-info'>

                            </CardHeader>
                            <CardBody>
                                <Row>
                                    <Col sm="12" md="8" lg="8" xl="8">
                                        <ReactPlayer playing={true} loop={true} muted={true} width={"100%"} height={"825px"} className={"custom-player-course-content"} wrapper={"div"} url={"https://cybersecurity-platform.s3.amazonaws.com/09d20510-781c-469b-96e9-f64a6de85557"} />
                                    </Col>
                                    <Col sm="12" md="8" lg="8" xl="8">

                                    </Col>
                                </Row>
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}

export default ViewIndividualPurchasedCourseDataHelper;
